uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Parameters
uniform float u_speed;
uniform float u_grid_intensity;
uniform float u_trail_length;
uniform float u_camera_drift;
uniform float u_hue_shift;
uniform float u_bloom;
uniform float u_distortion;

out vec4 fragColor;

// --- Constants ---
#define PI 3.14159265359
#define MAX_STEPS 100
#define SURF_DIST 0.01
#define MAX_DIST 100.0

// --- Utilities ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float hash(vec2 p) {
    p = fract(p * vec2(123.34, 456.21));
    p += dot(p, p + 45.32);
    return fract(p.x * p.y);
}

vec3 palette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(u_hue_shift, 0.6, 0.2);
    return a + b * cos(6.28318 * (c * t + d));
}

// --- Pathing ---
vec2 getPath(float z) {
    return vec2(
        sin(z * 0.1) * 3.0 + cos(z * 0.05) * 2.0,
        0.0 // Keep bikes on the ground plane
    );
}

// --- SDF Shapes ---
float sdBox(vec3 p, vec3 b) {
    vec3 q = abs(p) - b;
    return length(max(q, 0.0)) + min(max(q.x, max(q.y, q.z)), 0.0);
}

float sdCylinder(vec3 p, float h, float r) {
    vec2 d = abs(vec2(length(p.xz), p.y)) - vec2(r, h);
    return min(max(d.x, d.y), 0.0) + length(max(d, 0.0));
}

// --- Scene Mapping ---
float g_trail = 0.0;
float g_bike = 0.0;

float map(vec3 p) {
    float d = 1e10;

    // 1. Ground Plane
    float ground = p.y + 1.0;
    d = min(d, ground);

    // 2. The Bike (Simplified Light Cycle)
    vec3 bp = p;
    float timeZ = iTime * u_speed * 10.0;
    bp.xy -= getPath(timeZ);
    bp.z -= timeZ;

    // Bike body
    float body = sdBox(bp, vec3(0.4, 0.6, 1.2));
    // Wheels
    float wheel = sdCylinder(bp.zyx + vec3(-0.8, 0.0, 0.0), 0.5, 0.5);
    wheel = min(wheel, sdCylinder(bp.zyx + vec3(0.8, 0.0, 0.0), 0.5, 0.5));

    float bike = min(body, wheel);
    g_bike = bike;
    d = min(d, bike);

    // 3. Light Trails
    float z_step = 2.0;
    float z_quant = floor(p.z / z_step) * z_step;
    vec2 p_path = getPath(p.z);

    // Wall of light
    float trail = abs(p.x - p_path.x) - 0.05;
    trail = max(trail, p.y + 1.0); // Start from ground
    trail = max(trail, 1.5 - p.y); // Height of wall

    // Only show trail behind bike
    trail = max(trail, p.z - timeZ);
    trail = max(trail, (timeZ - u_trail_length * 20.0) - p.z);

    g_trail = trail;
    d = min(d, trail);

    return d;
}

vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // Camera Rail Setup
    float timeZ = iTime * u_speed * 10.0;
    vec3 pathPos = vec3(0.0, 0.0, timeZ);
    pathPos.xy += getPath(timeZ);

    // Cinematic camera following behind and slightly to the side
    vec3 ro = pathPos + vec3(3.0 * sin(iTime * 0.2), 2.5, -8.0);
    ro.x += sin(iTime * u_camera_drift) * 2.0;

    vec3 ta = pathPos + vec3(0.0, 0.5, 5.0);

    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f + uv.x * r + uv.y * u);

    // Raymarching
    float d = 0.0, t = 0.0;
    for(int i = 0; i < MAX_STEPS; i++) {
        d = map(ro + rd * t);
        if(d < SURF_DIST || t > MAX_DIST) break;
        t += d;
    }

    vec3 col = vec3(0.01, 0.02, 0.05); // Dark Digital Void

    if(t < MAX_DIST) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);

        // --- Shading Logic ---

        // Ground Grid
        if(p.y < -0.9) {
            vec2 grid = abs(fract(p.xz * 0.5 - 0.5) - 0.5) / fwidth(p.xz);
            float line = min(grid.x, grid.y);
            float gridVal = 1.0 - smoothstep(0.0, 1.0, line);

            // Grid glowing perspective
            float distFade = exp(-0.05 * t);
            col += gridVal * palette(0.6) * u_grid_intensity * distFade;

            // Grid secondary big lines
            vec2 grid2 = abs(fract(p.xz * 0.1 - 0.5) - 0.5) / fwidth(p.xz);
            float line2 = min(grid2.x, grid2.y);
            col += (1.0 - smoothstep(0.0, 1.2, line2)) * palette(0.5) * 0.5 * distFade;
        }

        // The Bike
        float bikeSDF = g_bike;
        if(abs(bikeSDF - d) < 0.001) {
            float fresnel = pow(1.0 - max(0.0, dot(n, -rd)), 3.0);
            col = vec3(0.1) + palette(u_hue_shift) * fresnel;
            // Digital glow lines on bike
            float strips = sin(p.z * 10.0) * 0.5 + 0.5;
            col += palette(u_hue_shift) * step(0.8, strips) * 2.0;
        }

        // The Trail
        float trailSDF = g_trail;
        if(abs(trailSDF - d) < 0.001) {
            col = palette(u_hue_shift) * 3.0;
            col += vec3(1.0) * pow(1.0 - abs(p.y - 0.25) / 1.25, 10.0); // Center core white
        }

        // Distance fog
        col *= exp(-0.02 * t);
    }

    // --- Volumetric Glow (Fake) ---
    // Sample along the ray to add atmosphere
    float glow = 0.0;
    for(float i=0.0; i<1.0; i+=0.1) {
        vec3 gp = ro + rd * t * i;
        float d_trail = abs(gp.x - getPath(gp.z).x);
        glow += exp(-d_trail * 2.0) * (1.0 - i);
    }
    col += palette(u_hue_shift) * glow * u_bloom * 0.2;

    // --- Post Processing ---

    // Digital Glitch
    if(hash(vec2(iTime * 10.0, floor(uv.y * 20.0))) < u_distortion) {
        col.r = texture(iChannel0, uv + vec2(0.01, 0.0)).r;
        col.b = texture(iChannel0, uv - vec2(0.01, 0.0)).b;
    }

    // Scanlines
    col *= 0.9 + 0.1 * sin(uv.y * iResolution.y * 1.5);

    // Vignette
    float vig = 1.0 - dot(uv, uv) * 0.5;
    col *= vig;

    // Tone mapping
    col = smoothstep(0.0, 1.1, col);
    col = pow(col, vec3(0.8));

    fragColor = vec4(col, 1.0);
}
